import React from "react";
import ReactDOM from "react-dom";
import { Heading } from "./heading.js";
import { responsive_mock } from "./responsive.js";
import cppimg from './cpp.png'
let text='Total\t\t\t\t\t\t:00\n\nattempted\t\t\t\t\t:00\n\nProgress\t\t\t\t\t:00'
export class Mocktest_header extends React.Component{
    constructor(){
        super()
        this.state={style:responsive_mock.header.Main(),heading:responsive_mock.header.heading(),text:responsive_mock.header.text(),button:responsive_mock.header.button()}
        this.resize=this.resize.bind(this)
        window.addEventListener('resize',this.resize)
    }
    resize()
    {
        this.setState({style:responsive_mock.header.Main(),heading:responsive_mock.header.heading(),text:responsive_mock.header.text(),button:responsive_mock.header.button()})
    }
    render(){
        return <div style={this.state.style}>
            <h1 style={this.state.heading}>MOCK TEST</h1>
            <hr style={{border:'0.5px solid grey'}}/>
            <textarea value={text}style={this.state.text}>
            </textarea>
            <hr style={{border:'0.5px solid grey'}}/>
            <div style={this.state.button} onClick={()=>ReactDOM.render(<Mocktest_page/>,document.getElementById('root'))}>
                {'Take Mocktest->'}
            </div>
        </div>
    }
}
class Mocktest_page extends React.Component{
    constructor(){
        super()
        //this.state={style:responsive_mock.mocktest_page.Main()}
    }
    resize(){
        this.setState({style:responsive_mock.mocktest_page.Main()})
    }
    render(){
        return<div>
            <Heading/>
            <Mocktest_block img={cppimg}/>
        </div>
    }
}
class Mocktest_block extends React.Component{
    constructor(props){
        super(props)
        this.state={style:responsive_mock.mockblock.header(),image:responsive_mock.mockblock.image(this.props.img)}
    }
    resize(){
        this.setState({style:responsive_mock.mockblock.header(),image:responsive_mock.mockblock.image(this.props.img)})
    }
    render(){
        return<div style={this.state.style}>
            <div style={this.state.image}></div>
            <hr style={{color:'grey'}}/>
        </div>
    }
}
